// import components
import Head from 'next/head';
import Layout from '../components/Layout';
import HeroImage from '../components/HeroImage';
import Header from '../components/Header';
import HamburguerButton from '../components/HamburguerButton';
import ScrollTop from '../components/ScrollTop';
import { SobreMi } from '../components/SobreMi';
import { ProyectsHome } from '../components/ProyectsHome';
import Footer from '../components/Footer';
import '../scss/mediaqueries.scss';

import sticky from '../../modules/sticky_footer';

const Index = (props) => {
  return (
    <Layout>
      <Head>
        <title>Porfolio Dami√°n Vigo</title>
      </Head>
      <HeroImage />
      <Header />
      <HamburguerButton />
      <ScrollTop />
      <SobreMi />
      <ProyectsHome />
      <Footer />
    </Layout>
  );
};

Index.getInitialProps = () => {
  const d = document;
  const w = window;

  d.addEventListener('DOMContentLoaded', (e) => {
    sticky('.header');
    // hamburguerMenu('.panel-btn', '.panel', '.panel__menu-a');
    // scrollTopButton('.scroll-top-btn');
    // darkMode('#switch');
  });
};

export default Index;
